import React from "react";

const Main = () => (
  <div className="cardContainer">
      <h1>Hello, world!</h1>
      <p>I'm a jumbotron!</p>
      <p>
        <button className="btn btn-primary btn-lg">
          Learn more
        </button>
      </p>
  </div>
);

export default Main;
